  false,\n\t\"url\": null,\n\t\"notes\": \"The Satellite View of the Conterminous
  United States map layer is a 200- meter-resolution simulated-natural-color image
  of the United States. Vegetation is generally green, with forests in darker green
  and grasslands or shrublands in lighter green. Areas of high reflectance, including
  urban areas, rock, and dry bare soil, are shown in shades of pink. Very bright areas,
  such as snow and ice, are colored blue. The image was produced by combining Landsat
  Thematic Mapper (TM) imagery from the Landsat 4 and Landsat 5 satellites. The National
  Atlas map layer released in December 2005 as Satellite View of the Conterminous
  United States is now called Satellite View of the Conterminous United States, with
  Shaded Relief.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
